// Login.jsx
import React from 'react';

const Login = ({ onLogin }) => {
    return (
        <div className="flex flex-col items-center justify-center min-h-screen bg-gray-900 text-white font-sans p-4">
            <div className="w-full max-w-sm p-8 bg-gray-800 rounded-xl shadow-2xl">
                <h2 className="text-2xl font-bold mb-4 text-center">
                    Welcome to the Chatbot
                </h2>
                <p className="text-center text-gray-300 mb-6">
                    Log in to view your chat history.
                </p>
                <button
                    onClick={onLogin}
                    className="w-full p-3 rounded-lg bg-indigo-600 text-white font-medium hover:bg-indigo-700 transition duration-300"
                >
                    Start Chatting Anonymously
                </button>
            </div>
        </div>
    );
};

export default Login;
